import React from 'react';
import Grid from '@material-ui/core/Grid';
import TypeBar from '../components/TypeBar';
import DeviceContainer from '../components/DeviceContainer';

const Content: React.FC = () => {
  return (
    <Grid item container>
      <TypeBar />
      <DeviceContainer />
    </Grid>
  );
};
export default Content;
